import { useState } from "react";
import Button from './Button';





function ButtonsPanel(props){
    return(
        <div>
            <Button value = {props.value} setValue = {props.setValue} clickHandler = {props.handleClick} buttonName = "1" />
            <Button value = {props.value} setValue = {props.setValue} clickHandler = {props.handleClick} buttonName = "2" />
            <Button value = {props.value} setValue = {props.setValue} clickHandler = {props.handleClick} buttonName = "3" />
            <Button value = {props.value} setValue = {props.setValue} clickHandler = {props.handleClick} buttonName = "4" />
            <Button value = {props.value} setValue = {props.setValue} clickHandler = {props.handleClick} buttonName = "5" />
            <Button value = {props.value} setValue = {props.setValue} clickHandler = {props.handleClick} buttonName = "6" />
            <Button value = {props.value} setValue = {props.setValue} clickHandler = {props.handleClick} buttonName = "7" />
            <Button value = {props.value} setValue = {props.setValue} clickHandler = {props.handleClick} buttonName = "8" />
            <Button value = {props.value} setValue = {props.setValue} clickHandler = {props.handleClick} buttonName = "9" />
            <Button value = {props.value} setValue = {props.setValue} clickHandler = {props.handleClick} buttonName = "0" />
            <Button value = {props.value} setValue = {props.setValue} clickHandler = {props.handleClick} buttonName = "+" />
            <Button value = {props.value} setValue = {props.setValue} clickHandler = {props.handleClick} buttonName = "-" />
            <Button value = {props.value} setValue = {props.setValue} clickHandler = {props.handleClick} buttonName = "*" />
            <Button value = {props.value} setValue = {props.setValue} clickHandler = {props.handleClick} buttonName = "/" />
            <Button value = {props.value} setValue = {props.setValue} clickHandler = {props.handleClick} buttonName = "=" />
        </div>
    );

}

export default ButtonsPanel;
